import React from "react";
import './styles/work.css';

const Work = () => {
	  return (
		<div className="work_container">
			<div className="work_title">/about/experience</div>
			<div className="my_work">
			As a Client-Facing Software Developer for eKlozet during Atlanta Sustainable 
			Fashion Week, I collaborated with a team of student developers to create a 
			sustainable fashion iOS mobile app for client Tanjuria Willis. My contributions 
			included developing a collaborative-filtering algorithm for personalized outfit 
			recommendations and designing a SQL database to manage user CRUD functionality,
			ultimately serving over 5,000 users. Additionally, I proficiently utilized
			Git/GitHub for code versioning and played a crucial role in coordinating team 
			responsibilities, ensuring the successful delivery of the project.
			</div>
		</div>
	  )
}

export default Work;
